import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

index:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,
    
},

index1:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    height:300,
    justifyContent:'center',
    // width: 300,
},

indexImg:{
    alignItems:'center',    
},


dados:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,
},

dadosText:{
    fontWeight:'bold',
    fontSize: 25,
    marginBottom:100,
},

dadosText1:{
    color:'#5C6B73',
    fontWeight:'100',
    fontSize: 25,
},
dadosTextInput:{
    borderColor:'#C2DFE3',
    borderStyle:'solid',
    borderWidth:1,
    margin:10,
    padding:20,
    
},

dadosTouch:{
    alignItems:'center',
    backgroundColor:'#5C6B73',
    borderStyle:'solid',
    borderWidth:1,
    borderRadius:10,
    height:30,
    justifyContent:'center',
    marginTop:30,
    marginBottom:100,
    width:80,
},

dadosTouchText:{
    color:'#E0FBFC',
    fontSize:20,
    fontWeight:'bold',
},
    
dicasImg:{
    height:100,
    width:100,
},
})
